import React from 'react';
import { NavLink } from 'react-router-dom';
import './Sidebar.css';

const Sidebar = () => {
  return (
    <aside className="sidebar">
      <nav className="sidebar-nav">
        <NavLink to="/payroll" className="sidebar-link">Payroll</NavLink>
        <NavLink to="/leaves" className="sidebar-link">Leaves</NavLink>
        <NavLink to="/compliance" className="sidebar-link">Compliance</NavLink>
        <NavLink to="/reports" className="sidebar-link">Reports</NavLink>
        <NavLink to="/salaryAdjustment" className="sidebar-link">Salary Adjustment</NavLink>
        <NavLink to="/payslips" className="sidebar-link">Payslips</NavLink>
      </nav>
    </aside>
  );
};

export default Sidebar;
